// This is the component to render the lists of uploaded files

import React, { useState, useEffect } from "react";

function Uploaded() {
  const [files, setfiles] = useState({});

  useEffect(() => {
    fetch("http://localhost:5000/upload")
      .then((res) => res.json())
      .then((data) => {
        setfiles(data);
      });
  }, []);

  console.log(files);
}

export default Uploaded;
